import "./styles/App.css";
import { fetchLanyard } from "./hooks/useLanyard.ts";
import { useEffect, useState } from "react";

export function App() {
  const [data, setData] = useState<any | null>(null);

  useEffect(() => {
    fetchLanyard().then((data) => setData(data));
  }, []);

  return <div></div>;
}

export default App;
